import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { BsCamera } from 'react-icons/bs';
import Header from '../Shared/Header/Header'
import './UserProfile.css';

const UserProfile = () => {
    return (
        <div>
            <Header />
            <Container className="cover-photo-container" fluid>
                <Row>
                    <Col className="p-0 m-0">
                        <img className="img-fluid w-100" src="http://www.wpkixx.com/html/winku-dark/images/resources/timeline-1.jpg" alt="Cover_Photo" />
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <div className="profile-img-container rounded-pill">
                            <img className="img-fluid rounded-pill" src="http://www.wpkixx.com/html/winku-dark/images/resources/user-avatar.jpg" alt="Profile_Photo" />
                            <div className="profile-img-upload-container d-flex align-items-center justify-content-center rounded-pill">
                                <label for="img"><BsCamera style={{ color: '#088dcd' }} className="text-white fs-4" /></label>
                                <input id="img" accept="image/*" type="file" style={{ display: 'none' }} />
                            </div>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default UserProfile;
